                <CardContent>
                <Typography align="left" color="primart" variant='h5'>Leks Lundary</Typography>
                <Typography variant='h6' color='textSecondary'>Double drawn human hair</Typography>
                <Typography variant='h5' >8,000.00</Typography>
                </CardContent>
                <CardActions>

                </CardActions>
            </Card>
        </Container>
    )
}

export default Posts
